import React from 'react';
import '../style/Header.css';
import Card from "react-bootstrap/Card";


const Weatheroutput = ({ description, city,  error, temperature,country,temperaturemin,temperaturemax }) => {
    return (
        <div className="WeaOutput">
            <Card className="bg-info text-dark text-center card ">
                <Card.Title >Weather of your city </Card.Title>
                <Card.Text>
                    {city && <p>{city}</p>}
                    {country && <p>{country}</p>}
                    {temperature && <p>{temperature}</p>}
                    <p>min tem</p>{temperaturemin && <p>{temperaturemin}</p>}
                    {temperaturemax && <p>{temperaturemax}</p>} 
                    {description && <p> {description}</p>}
                    {error && <p>{error}</p>}
                </Card.Text>
            </Card>



        </div>
    )
}

export default Weatheroutput;
